import React from 'react'

const Header = () => {
  return (
    <header style={{
        fontFamily:'cursive',
        textAlign:'center',
        color:'linear-gradient(135deg, #dd3036ff, #8d2c11ff);',
        fontSize:'60px',
        background:'none',
        padding:'none',
        margin:'auto'
    }}>
      RATE-RIGHT
    </header>
      
  )
}

export default Header
